import FoodItem from "./FoodItem";
import "./ListFood.css";

const ListFood = (props) => {
    const {products} = props;
    return (
        <div className="container">
            <div className="list_food_items">
                <FoodItem />
                <FoodItem />
                <FoodItem />
            </div>
        </div>
    )
}

export default ListFood;
